import styled from "styled-components";

export const Wrapper = styled.div `
    padding: 5px 2em;
    width: 100%; overflow: hidden;
    position: absolute:
    bottom: 0;
    right: 0;

    clear: both;
    position: relative;
    height: 200px;
    margin-top: -200px;
`;
